ExprLine.OrigStr:
			GenSetString(Self, "Text", "");

			if (NOT(ContactGetName(Player) = ""))
				GenAppendString(Self, "Text", "<font style=Game_Header>");
				GenAppendString(Self, "Text", Player.pPlayer.pInteractInfo.ContactDialog.DialogHeader);
				GenAppendString(Self, "Text", "</font>");
			endif

			if (NOT(Player.pPlayer.pInteractInfo.ContactDialog.DialogText1 = ""))
				GenAppendString(Self, "Text", "<font scale=0.2><br><br></font><font>");
				GenAppendString(Self, "Text", Player.pPlayer.pInteractInfo.ContactDialog.DialogText1);
				GenAppendString(Self, "Text", "</font><br>");
			endif

			if (NOT(Player.pPlayer.pInteractInfo.ContactDialog.DialogText2 = ""))
				if (NOT(Player.pPlayer.pInteractInfo.ContactDialog.DialogHeader2 = ""))
					GenAppendString(Self, "Text", "<br><font style=Game_Header>");
					GenAppendString(Self, "Text", Player.pPlayer.pInteractInfo.ContactDialog.DialogHeader2);
					GenAppendString(Self, "Text", "</font>");
				endif

				GenAppendString(Self, "Text", "<font scale=0.2><br><br></font><i><font>");
				GenAppendString(Self, "Text", Player.pPlayer.pInteractInfo.ContactDialog.DialogText2);
				GenAppendString(Self, "Text", "</font></i>");
			endif

			#Show team size info
			if (Player.pPlayer.pInteractInfo.ContactDialog.TeamSize > 0)
				GenAppendString(Self, "Text", "<br><br><font color=Yellow>");
				GenAppendString(Self, "Text", Translate("ContactUI.TeamSizeText"));
				GenAppendString(Self, "Text", "</font>");
			elif (Player.pPlayer.pInteractInfo.ContactDialog.ScalesForTeam)
				GenAppendString(Self, "Text", "<br><br><font color=Yellow>");
				GenAppendString(Self, "Text", Translate("ContactUI.ScalesForTeamText"));
				GenAppendString(Self, "Text", "</font>");
			endif

			#Show warning for Timed Missions
			if (Player.pPlayer.pInteractInfo.ContactDialog.MissionTimeLimit > 0)
				GenAppendString(Self, "Text", "<br><br><font color=Yellow>");
				GenAppendString(Self, "Text", FormatTimer("ContactUI.TimedMissionWarning", ContactDialogGetMissionTimer(Player)));
				GenAppendString(Self, "Text", "</font>");
			endif

			#Show warning for Lockout Missions
			if (NOT(Player.pPlayer.pInteractInfo.ContactDialog.MissionLockoutType = 0))
				GenAppendString(Self, "Text", "<br><br><font color=Yellow>");
				GenAppendString(Self, "Text", Translate("ContactUI.MissionLockoutWarning"));
				GenAppendString(Self, "Text", "</font>");
			endif

			#Show warning for Shadow Missions
			if (Player.pPlayer.pInteractInfo.ContactDialog.MissionCreditType = MissionCreditTypeIneligible)
				GenAppendString(Self, "Text", "<br><br><font color=yellow>");
				GenAppendString(Self, "Text", Translate("ContactUI.ShadowMissionIneligibleWarning"));
				GenAppendString(Self, "Text", "</font>");
			elif (Player.pPlayer.pInteractInfo.ContactDialog.MissionCreditType = MissionCreditTypeAlreadyCompleted)
				GenAppendString(Self, "Text", "<br><br><font color=yellow>");
				GenAppendString(Self, "Text", Translate("ContactUI.ShadowMissionAlreadyCompletedWarning"));
				GenAppendString(Self, "Text", "</font>");
			elif (Player.pPlayer.pInteractInfo.ContactDialog.MissionCreditType = MissionCreditTypeFlashback)
				GenAppendString(Self, "Text", "<br><br><font color=yellow>");
				GenAppendString(Self, "Text", Translate("ContactUI.FlashbackMissionWarning"));
				GenAppendString(Self, "Text", "</font>");
			endif

			if (ContactDialogHasNonChoosableReward(Player))
				GenAppendString(Self, "Text", "<br><br><font style=Game_Header>");
				GenAppendString(Self, "Text", Player.pPlayer.pInteractInfo.ContactDialog.RewardsHeader);
				GenAppendString(Self, "Text", "</font>");

				GenAppendString(Self, "Text", "<table><font>");
				if (ContactDialogGetRewardCount(Player, "Resources") > 0 and ContactDialogGetRewardCount(Player, "Xp") > 0)
					GenAppendString(Self, "Text", "<tr><td><font scale=0.2><br><br></font>" + ContactDialogGetRewardStringFiltered(Player, Self.Var[RewardExpCell].String, Self.Var[RewardExpCell].String, "Xp", "") + "</td></tr>");
					GenAppendString(Self, "Text", "<tr><td><font scale=0.2><br><br></font>" + InventoryGetNumericString3(ContactDialogGetRewardCount(Player, "Resources"), "Inventory_Numeric3_Resources_Left", 100, 100) + "</td></tr>");
				elif (ContactDialogGetRewardCount(Player, "Xp") > 0)
					GenAppendString(Self, "Text", "<tr><td><font scale=0.2><br><br></font>" + ContactDialogGetRewardStringFiltered(Player, Self.Var[RewardExpCell].String, Self.Var[RewardExpCell].String, "Xp", "") + "</td></tr>");
				elif (ContactDialogGetRewardCount(Player, "Resources") > 0)
					GenAppendString(Self, "Text", "<tr><td><font scale=0.2><br><br></font>" + InventoryGetNumericString3(ContactDialogGetRewardCount(Player, "Resources"), "Inventory_Numeric3_Resources_Left", 100, 100) + "</td></tr>");
				endif

				# Catch all rows
#				GenAppendString(Self, "Text", ContactDialogGetRewardStringFiltered(Player, Self.Var[RewardRow].String, Self.Var[RewardRowWithValue].String, "", "Resources Xp"));

				GenAppendString(Self, "Text", "</font></table>");
			endif

