#				GenAppendString(Self, "Text", "<br><p><font style=Game_Header>");
#				GenAppendString(Self, "Text", Player.pPlayer.pInteractInfo.ContactDialog.OptionalRewardsHeader);
#				GenAppendString(Self, "Text", "</font>");
#
#				GenAppendString(Self, "Text", "<table><font style=Game_HUD>");
#				GenAppendString(Self, "Text", ContactDialogGetChoosableRewardString(Player, Self.Var[RewardRow].String, Self.Var[RewardRowWithValue].String));
#				GenAppendString(Self, "Text", "</font></table></p>");
#			endif
#			GenAppendString(Self, "Text", "<br>");
